Jeff Dunham is terug met zijn langverwachte vierde show: Controlled Chaos. Een show met alleen maar splinternieuw materiaal. Alle favoriete karakters komen in deze hilarische show voorbij: de oude brombeer Walter, de manische Peanut, Jose JalapeÃƒÆ’Ã‚Â±o de Mexicaanse peper, en natuurlijk de wereldberoemde Achmed The Dead Terrorist. Bovendien wordt Jeff Dunham bijgestaan door twee nog niet eerder vertoonde karakters, die zorgen voor een flinke chaos op het podium!

Jeff Dunham is na het succes van Achmed The Dead Terrorist een wereldwijd fenomeen geworden. Zo verkoopt hij overal de grootste zalen uit en heeft hij meer dan een half miljard Youtubeviews. Controlled Chaos is een geweldige show waar iedereen dubbel om zal liggen: of je nu Dunham-fan bent of hem en zijn karakters voor het eerst ziet. 


